  var four = Math.floor(Math.random() / 1000);
  var three = Math.floor(Math.random() / 100);
  var two = Math.floor(Math.random() / 10);
  var one = Math.floor(Math.random() / 1);
  console.log(four, three, two, one);
  counter++;
  function Counter() {
    return (
      <div>
        <Timp
          DigitOne={one}
          DigitTwo={two}
          DigitThere={three}
          DigitFour={four}
        />
      </div>
    );
  }
}, 1000);

Counter.propTypes = {
  DigitFour: PropTypes.number,
  DigitThere: PropTypes.number,
  DigitTwo: PropTypes.number,
  DigitOne: PropTypes.number,
};

